FormAction.Script:
if(thisForm.formVariables.getFormVariableByName('ProfilePictureName').value != ""){
var url = window.location.protocol + "//" + window.location.host + "/";
if(window.WEBSITEBASENAME != "")
{
url = url + window.WEBSITEBASENAME +"/";
}
url = url + "Forms/DeployedImages/"+thisForm.formVariables.getFormVariableByName('ProfilePictureName').value + "?ResourceId=" + Forms.Common.Common.GetResourceID();

var imageLocation= thisForm.controlManager.getControlByName('btnProfile');
var s='<div class="ta-imagebutton" style=""><img src="'+url + '" height="25" width="25"/></div>';
imageLocation.setControlData(s);
}

var landingTAForm = thisForm.dataHelper.retrieveData('PersonaLandingTAForm', Forms.Constants.TYPE.FORM_VARIABLE);
var landingExternalForm = thisForm.dataHelper.retrieveData('PersonaLandingExternalForm', Forms.Constants.TYPE.FORM_VARIABLE);
// Form mapping variables if exists
var mappingVariables = ''; // write a method to extract from the form variable LandingPageMappingVariables

var mappingVarArray = thisForm.formVariables.formVariableArray[2];
if (mappingVarArray.value.length > 0)
{
var mappingVariables = '?'
for (var i = 0; i < mappingVarArray.value.length; i++) {
if(mappingVarArray.value[i][2] == true)
{
mappingVarArray.value[i][1] = sessionStorage[mappingVarArray.value[i][1]];
if(!mappingVarArray.value[i][1])
{
mappingVarArray.value[i][1] = '';
}
}
mappingVariables = mappingVariables + mappingVarArray.value[i][0] + '=' + mappingVarArray.value[i][1] + '&';
}
//remove last &
mappingVariables = mappingVariables.substr(0, mappingVariables.length - 1);
}

if (landingTAForm) {
formUrl = landingTAForm + '.form' + mappingVariables;
if (Forms.Common.Common.GetKeyValue('EmbeddedFormMode')) {
window.open(formUrl, '_blank', '');
}
else {
window.location = formUrl;
}
}

else if (landingExternalForm) {
formUrl = landingExternalForm;
if (formUrl.indexOf('.form') < 0 && Forms.Common.Common.GetSiteName() != '' && Forms.Common.Common.GetSiteName() != null && formUrl.indexOf('http') < 0 && formUrl.indexOf('https') < 0) {
if (formUrl.indexOf('./') == 0)
formUrl = '.' + formUrl;
else
formUrl = '../' + formUrl;
}
formUrl = formUrl + mappingVariables;
 if (formUrl.substring(0, 7) != 'http://' && formUrl.substring(0, 8) != 'https://')
{
formUrl = 'http://' + formUrl;
}
if (Forms.Common.Common.GetKeyValue('EmbeddedFormMode')) {
window.open(formUrl, '_blank', '');
}
else {
window.location = formUrl;
}
}

if(thisForm.formVariables.getFormVariableByName('PersonaLandingTAForm').value == null)
{
thisForm.formVariables.getFormVariableByName('PersonaLandingTAForm').value = '';
}
if (thisForm.formVariables.getFormVariableByName('PersonaLandingExternalForm').value == null) {
thisForm.formVariables.getFormVariableByName('PersonaLandingExternalForm').value = '';
}
